    {% include 'parts/_navbar.html.twig' %}
{% endblock %}

<main class=\"main\">
    <div class=\"container\">
        {% block notification %}
            {% for category, messages in app.flashes %}
                {% for message in messages %}
                    <div class=\"alert alert-{{ category }} mt-3 mb-3 text-center\">
                        {{ message }}
                    </div>
                {% endfor %}
            {% endfor %}
        {% endblock %}
        {% block body %}{% endblock %}
    </div>
</main>

{% block javascripts %}
    {{ encore_entry_script_tags('app') }}
{% endblock %}
<script src=\"https://kit.fontawesome.com/bfe9f51c30.js\" crossorigin=\"anonymous\"></script>
</body>
</html>
